import React, { Component } from "react";
import { Button } from "react-bootstrap";
import Collapsible from "react-collapsible";
import approve_business from "../services/approve_business";

function CollapsibleBusiness(props) {

  function Approve(id){
    approve_business.approve(id)
    console.log(id)
  }

  function deny(id){
    approve_business.approve(id)
    console.log(id)
  }

  return (
    <div style={{ backgroundColor: "white" }}>
      <Collapsible
        //   triggerStyle={{ backgroundColor: "grey" }}  // Does not work because of trigger
        //   trigger=<p>
        //     This is the title <Button>Approve</Button>
        //     <Button>Deny</Button>
        //   </p>
        trigger={
        <div>
          {props.businessName}
       
        </div>
        }
      >
        <div style={{ backgroundColor: "lightblue" }}>
          <img src={props.image} />

          <p>
            <b>User ID: </b>
            {props.UserID}
          </p>


          <p>
            <b>Business Id: </b>
            {props.businessId}
          </p>
          <p>
            <b>Application Date: </b>
            {props.applicationDate}
          </p>
          <p>
            <b>Business Structure: </b>
            {props.businessStructure}
          </p>
          <p>
            <b>Description: </b>
            {props.description}
          </p>
          <p>
            <b>Genre: </b>
            {props.genre}
          </p>
          <p>
            <b>Address 1: </b>
            {props.address1}
          </p>
          <p>
            <b>Address 2: </b>
            {props.address2}
          </p>
          <p>
            <b>City: </b>
            {props.city}
          </p>
          <p>
            <b>State: </b>
            {props.state}
          </p>
          <p>
            <b>Zip: </b>
            {props.zip}
          </p>
          <p>
            <b>Phone: </b>
            {props.phone}
          </p>
          <p>
            <b>Website: </b>
            {props.website}
          </p>
          <p>
            <b>Email: </b>
            {props.email}
          </p>
          <Button onClick={() => Approve(props.UserID)} variant="outline-danger" >Approve</Button>
        
          <Button onClick={() => deny(props.UserID)} variant="outline-danger">Deny</Button>
        </div>
      </Collapsible>
    </div>
  );
}

export default CollapsibleBusiness;
